import React from "react";

const boxGenerator = () => {
  for (let i = 0; i < 100; i++) {
    return <div className="grid__box">I'm box</div>;
  }
};

class App extends React.Component {
  render() {
    return (
      <div className="mainWrapper">
        I'm wrapper
        <div className="grid">
          I'm grid
          <div className="grid__box">I'm box</div>
          {this.boxGenerator()}
        </div>
      </div>
    );
  }
}

export default App;
